INSERT INTO `categories` VALUES (2,NULL,'Kitchen doors','1-kitchen-doors','Kitchen doors',1,'2018-05-29 13:00:35','2018-05-29 13:00:35'),(3,NULL,'Kitchen units','2-kitchen-units',NULL,2,'2018-05-30 05:05:10','2018-05-30 05:05:10'),(4,NULL,'Essential components','3-essential-components',NULL,3,'2018-05-30 05:05:20','2018-05-30 05:05:20'),(5,NULL,'Accessories','5-accessories','CHOOSE YOUR NEW HANDLES, HINGES, DRAWER SYSTEMS AND INTERNAL STORAGES\r\n\r\nChoose your new Handles, Hinges, Plinths, End Panels, Curved Doors and Storage Drawers.',4,'2018-05-30 05:05:38','2018-05-30 05:15:16'),(6,NULL,'Sample','5-sample',NULL,5,'2018-05-30 05:06:18','2018-05-30 05:06:18'),(7,2,'High Gloss Doors','7-high-gloss-doors','The kitchen is the first place you should start with, if you have a home that needs renovation. Your kitchen  should be the heart of your home, the place where you will prepare culinary delights, but also a place that will gather friends, unite the whole family, solve your problems and your common future. Harmonious design will help you make your home a source of warmth, love and well-being. That\'s why it\'s important that your kitchen not only has everything to do in it but it becomes beautiful and functional place to enjoy. Renovating the kitchen, such as new kitchen cabinet doors, is one of the best ways to invest your money, as much of the cost is reflected in the increased value of your home.\r\n\r\nWe stand behind our products by working with some of the best English and Italian factories to produce kitchen doors and cabinets. Thanks to the modern production, custom-made kitchen cabinets are more cost-effective than ever, while maintaining the best quality and price. Our high quality brands are not the only thing we are proud of when it comes to kitchen doors and kitchen cabinets. We want you to be so happy with the work on renovating your kitchen, so we can assure you that we only use proven brands for all our customers. With the great variety of colour and style we offer, we strive to satisfy your wishes. Using your imagination, you can choose different styles and colours from our wide range of products, bring a more modern look at your new kitchen with curved doors and panels and turn your dream into reality.',1,'2018-05-30 05:09:44','2018-05-30 05:09:44'),(8,2,'Matt Doors','8-matt-doors',NULL,2,'2018-05-30 05:10:32','2018-05-30 05:10:32'),(9,2,'Woodgrain Doors','9-woodgrain-doors',NULL,3,'2018-05-30 05:10:54','2018-05-30 05:10:54'),(10,2,'Traditional Doors','10-traditional-doors','We believe the kitchen is the heart of the home. Creating a beautiful kitchen that suits your home and taste will always add value to your house. Experience a feeling of warmth, tradition and style as soon as you step into one of our Traditional style doors. Do you love to entertain? From the moment your guests enter, it will be clear that your kitchen will be the scene for many a culinary masterpiece.There are 38 traditional types of doors to select from, each with an individual charm to suit your preference. This highly sophisticated style has many interesting design elements, which can be expertly made to measure, perfectly suited to your home and today’s modern lifestyle.This traditional style often uses soft, subtle colours such as cream, matt dakar, alabaster, neutrals oak, and off-whites. These colours are used to highlight the elaborate design elements of the unique style.\r\n\r\nIf Portsmouth’s coastal charm, English musings, or something more traditional is more your style, then, with our many door styles, multiple decorative features and limitless colour options, at KITCHENIN you can find everything you want. We take genuine pride in every item we offer. The elegant aesthetic may look simple, but every element is carefully considered. Every item is crafted from the finest environmentally friendly materials, using the latest state of the art equipment and then hand finished by our talented craftsmen.',4,'2018-05-30 05:13:04','2018-05-30 05:13:04'),(11,2,'Paintable Doors','11-paintable-doors',NULL,5,'2018-05-30 05:13:22','2018-05-30 05:13:22'),(12,2,'Handleless Doors','12-handleless-doors','One of KITCHENIN\'s wishes is to offer you the wonderful design of kitchen doors. We are constantly updating new styles to improve functionality and efficiency. We present you an ultra-modern J-pull handleless door, original and beautiful, and the selection is varied, enabling you to complement each individual style. These doors have a J-shaped groove that lets you put your hand in the trough, easily and gently to open your doors. So they always remain clean and glamorous. Our great variety of colour and style will make your choice easy.\r\n\r\nIf you want your new kitchen to have a clean and elegant design, modern and sophisticated vision, we at KITCHENIN strongly recommend that you choose a 22mm J-pull handleless kitchen door. So you can make your kitchen more than a kitchen- this is a way of life, exceptional value and investment in your home. We present unique products, high quality materials, panels and internal components at affordable prices.',6,'2018-05-30 05:14:05','2018-05-30 05:14:05'),(13,5,'Hindges','13-hindges',NULL,1,'2018-05-30 05:15:33','2018-05-30 05:15:33'),(14,5,'Handles','14-handles',NULL,2,'2018-05-30 05:16:00','2018-05-30 05:16:00'),(30,5,'Drawer Systems','15-drawer-systems',NULL,3,'2018-05-30 05:16:13','2018-05-30 05:16:13'),(31,5,'Internal Storages','16-internal-storages',NULL,4,'2018-05-30 05:16:22','2018-05-30 05:16:22'),(32,5,'Door Lift Mechanisms','17-door-lift-mechanisms',NULL,5,'2018-05-30 05:16:33','2018-05-30 05:16:33');
